import { Link } from 'react-router-dom'

function RightBelow() {
  return (
    <div className="border-2 border-black bg-amber-200 h-[320px] overflow-y-auto mt-1">
      <div className="m-1 p-4 border-1 border-black bg-white">
        <p>ABOUT</p>
      </div>
      <img src="/img/1-tree/raccoon.PNG" alt="" className="w-[200px]" />
    </div>
  )
}

export default RightBelow
